import React, { useState, useEffect } from 'react';
import MenuItems from './MenuItems';
import menuData from '.././db.json'

const MenuPage = () => {
  const [coffeeItems, setCoffeeItems] = useState([]);
// hello gimothee
  useEffect(() => {
    // Use the imported data directly in development
    setCoffeeItems(menuData.coffeeItems);
  }, []);

const menuItems = [
  { id: 1, name: 'Burger', price: 9.99 },
  { id: 2, name: 'Pizza', price: 12.99 },
  { id: 3, name: 'Salad', price: 7.99 },
  // Add more menu items as needed
];

  return (
    <div className="menu-page">
      <h1>Menu</h1>
      <div className="menu-list">
        {coffeeItems.map((item) => (
          <MenuItems key={item.id} id={item.id} name={item.name} price={item.price} image={item.image} />
        ))}
      </div>
    </div>
  );
};

export default MenuPage;
